  false,\n\t\"url\": null,\n\t\"notes\": \"This is a survey of federal departments
  and agencies who share terrorism information and are therefore considered part of
  the Information Sharing Environment. The ISE Performance Framework allows us to
  assess improvements to the nation's ability to detect, analyze, and respond to terrorism,
  WMD, and homeland security threats. The goals and sub-u0090goals in the framework
  are aligned to the White House's strategic guidance, priorities, and to the required
  ISE attributes in the Intelligence Reform and Terrorism Prevention Act of 2004,
  Section 1016(b)(2). This year's data is a survey of Air Force Intelligence, Army
  Intelligence, Central Intelligence Agency, Department of Energy, Department of Homeland
  Security, Defense Intelligence Agency, Department of Commerce, Department of Defense,
  Department of Health and Human Services, Department of Interior, Department of Justice,
  Department of State, Department of Transportation, Department of the Treasury, Federal
  Bureau of Investigation, Marine Corps Intelligence, National Counterterrorism Center,
  National Geospatial Agency, National Reconnaissance Office, and the Office of the
  Director of National Intelligence.\",\n\t\"license_title\": null,\n\t\"extras\":
